//server
package main

import (
	"encoding/json"
	"fmt"
	"log"
	"net"
	"sync"
)


type Datas struct {
	ID		string		`json:"id"`
	Text	string		`json:"text"`
}


var (
	clients = make(map[net.Conn]string)
	mu sync.Mutex
)


func handleConnection(conn net.Conn, id string) {
    defer func()  {
		conn.Close()
		mu.Lock()
		delete(clients, conn)
		mu.Unlock()
	}()


    for {
		var dec = json.NewDecoder(conn)

		var datas Datas

		if err := dec.Decode(&datas); err != nil {
			return
		}

		fmt.Println(datas)

		mu.Lock()
        for client, roomID := range clients {
			if roomID == id && client != conn {
				if err := json.NewEncoder(client).Encode(&datas); err != nil {
					log.Println(err)
					return
				}
			}
		}
		mu.Unlock()
    }
}


func startServer() {
	addr, err := net.ResolveTCPAddr("tcp", ":8000")

    if err != nil {
        log.Println(err)
		return
    }

    ln, err := net.ListenTCP("tcp", addr)

    if err != nil {
        log.Println(err)
		return
    }

    defer ln.Close()

    for {
        conn, err := ln.Accept()

        if err != nil {
            log.Println(err)
			return
        }

		var idB = make([]byte, 1024)

		n, err := conn.Read(idB)

		if err != nil {
			log.Println(err)
			return
		}

		var id = string(idB[:n])

		mu.Lock()
		clients[conn] = id
		mu.Unlock()

		fmt.Println(clients)

	    go handleConnection(conn, id)
	}
}

