// === TOKENIZER ===
function tokenize(input) {
  const tokens = [];
  let i = 0;

  function match(str) {
    return input.startsWith(str, i);
  }

  function advance(n) {
    i += n;
  }

  function push(type, value = null) {
    tokens.push({ type, value: value ?? type });
  }

  while (i < input.length) {
    if (match('\n*\n')) {
      push('T_CK', '\n*\n');
      advance(3);
    } else if (match('@sel(')) {
      push('T_SEL_OPEN', '@sel(');
      advance(5);
    } else if (match('@ed()')) {
      push('T_EDIT', '@ed()');
      advance(6);
    } else if (match(')')) {
      push('T_PAREN_CLOSE', ')');
      advance(1);
    } else if (match('/')) {
      push('T_SLASH', '/');
      advance(1);
    } else {
      const start = i;
      while (
        i < input.length &&
        !match('\n*\n') &&
        !match('@sel(') &&
        !match('@ed()') &&
        !match(')') &&
        !match('/')
      ) {
        i++;
      }
      const text = input.slice(start, i).trim();
      if (text) {
        push('T_TEXT', text);
      }
    }
  }

  return tokens;
}

// === PARSER ===
function parse(tokens) {
  let pos = 0;
  let clCounter = 1;
  let eCounter = 1;

  function peek(type) {
    return tokens[pos]?.type === type;
  }

  function consume(type) {
    const token = tokens[pos];
    if (!token || token.type !== type) {
      throw new Error(`Expected ${type}, got ${token?.type} at position ${pos}`);
    }
    pos++;
    return token;
  }

  function parseText() {
    const token = consume('T_TEXT');
    return { type: 'text', value: token.value };
  }

  function parseEdit() {
    consume('T_EDIT');
    return { type: 'edit', id: `e-${eCounter++}` };
  }

  function parseDropdown() {
    consume('T_SEL_OPEN');

    const options = [];
    options.push(consume('T_TEXT').value);

    while (peek('T_SLASH')) {
      consume('T_SLASH');
      options.push(consume('T_TEXT').value);
    }

    consume('T_PAREN_CLOSE');

    return { type: 'dropdown', id: `e-${eCounter++}`, options };
  }

  function parseE() {
    if (peek('T_SEL_OPEN')) return parseDropdown();
    if (peek('T_EDIT')) return parseEdit();
    if (peek('T_TEXT')) return parseText();
    throw new Error(`Unexpected token at position ${pos}: ${tokens[pos]?.type}`);
  }

  function parseExpr() {
    const elements = [];
    while (
      peek('T_TEXT') ||
      peek('T_EDIT') ||
      peek('T_SEL_OPEN')
    ) {
      elements.push(parseE());
    }
    return elements;
  }

  function parseCl() {
    consume('T_CK');
    const items = parseExpr();
    return {
      id: `cl-${clCounter++}`,
      checked: false,
      items
    };
  }

  function parseProgram() {
    const result = [];
    while (peek('T_CK')) {
      result.push(parseCl());
    }
    return result;
  }

  return parseProgram();
}

